import 'Catalog.css';
export default function Catalog () {
	return (
	<div class="sivu"> 
        <img src="jeans3.jpg" alt="Denim Jeans"></img>
        <h1>Tailored Jeans</h1>
        <p class="price">$19.99</p>
        <p>Some text about the jeans..</p>
        <p><button>Add to Cart</button></p>
    </div>
);
}
